import React, { useState, useEffect } from 'react'
import { Nav, Navbar, NavbarBrand, NavbarNav, NavbarToggler, NavItem, NavLink, NavDropdown, Container } from 'react-bootstrap';
import './topBar.css';

const TopBar = () => {
  const [weather, setWeather] = useState({});

  useEffect(() => {
    fetch(
      `https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/Allentown%2C%20PA?unitGroup=us&key=9STJKDTHMUJ8FT23YSZHW5D7K&contentType=json`
    )
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      });
  }, []);

  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand>Lehigh Valley Tourism Bureau</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <NavDropdown title="Weather in the Lehigh Valley!" id="basic-nav-dropdown">
                <NavDropdown.Item>Current Temperature: {weather.currentConditions.temp}Â° F </NavDropdown.Item>
                <NavDropdown.Item>Current Conditions: {weather.currentConditions.conditions}</NavDropdown.Item>
                <NavDropdown.Item>Chance of PrecipitationPrecipitation: {weather.currentConditions.wind}</NavDropdown.Item>
                <NavDropdown.Item>Windspeed: {weather.currentConditions.windspeed} mph</NavDropdown.Item>
                <NavDropdown.Item>Humidity: {weather.currentConditions.humidity}%</NavDropdown.Item>
                <NavDropdown.Item>Visibility: {weather.currentConditions.visibility} miles</NavDropdown.Item>
                <NavDropdown.Item>Current UV Index: {weather.currentConditions.uvindex}</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default TopBar;
